<span class="line"><span style="--shiki-light:#6F42C1;--shiki-dark:#B392F0;">    jaggr</span><span style="--shiki-light:#032F62;--shiki-dark:#9ECBFF;"> @count=rps</span><span style="--shiki-light:#005CC5;--shiki-dark:#79B8FF;"> \\</span></span>
